import React from "react";
import { Link } from "react-router-dom";
// Style
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';

export const LogoLink = () => {
  return (
    <Typography
      variant="h6"
      sx={{ pl: 2 }}
    >
      <Box
        button
        component={Link}
        sx={{ letterSpacing: 4 }}
        to={`/`}
        underline="none"
      >
        <b>睡眠補完計画</b>
      </Box>
    </Typography>
  )
}
